using KinoPolis.Data.Models;
using System;
using System.Collections.Generic;
using System.Text;
using System.Threading.Tasks;

namespace KinoPolis.Data.Seeding
{
    public class FilmsSeeder : ISeeder
    {
        public async Task SeedAsync(ApplicationDbContext dbContext, IServiceProvider serviceProvider)
        {
            var films = new List<(string Name, string Category, string Country, int Year, int Lenght, string Description, string ImgUrl)>
            {
              ("Avengers: Endgame", "Action", "United States", 2019, 181, "Directed by the Russo brothers, Avengers: Endgame is the final film in a 22-part series that has followed The Avengers, as well as the whereabouts of six powerful gems known as the Infinity Stones, the forces of which left half of Marvel's heroes dead at the end of last year's Avengers: Infinity War.", "data:image/jpeg;base64,"),
              ("Star Wars: The Rise of Skywalker", "Action/Fantasy", "United States", 2019, 142, "The Rise of Skywalker follows Rey, Finn, and Poe Dameron as they lead the Resistance's final stand against Kylo Ren and the First Order, who are now aided by the return of the deceased galactic emperor, Palpatine.","data:image/jpeg;base64,"),
              ("Frozen II","Comedy/Animation", "United States",2019,103,"Anna, Elsa, Kristoff, Olaf and Sven leave Arendelle to travel to an ancient, autumn-bound forest of an enchanted land. They set out to find the origin of Elsa's powers in order to save their kingdom.","data:image/jpeg;base64,"),
            };
            foreach (var film in films)
            {
                await dbContext.Films.AddAsync(new Film
                {
                    Name = film.Name,
                    Category = film.Category,
                    Country = film.Country,
                    Year = film.Year,
                    Lenght = film.Lenght,
                    Description = film.Description,
                    ImgUrl = film.ImgUrl,
                });
            }

        }
    }
}
